import React, { Component } from 'react';
import Map from './globe_map.js';
import Header from './header.js';
import FlightCount from './flight_count.js';
import Footer from './footer.js';
import './App.css';

export default class App extends Component {
  render() {
    return (
      <>
      <div className="App">
        <Header />
        <Map />
        <FlightCount />
        <Footer />
      </div>
      </>
  );
 }
}
